@APUkraine and #US agreed what will be considered a victory for Ukraine in the war:
 ▪️complete de-occupation of all territories of Ukraine (including Donbass and Crimea);
 ▪️payment of reparations by Russia;
 ▪️international guarantees that will not allow the RF to attack again. https://t.co/8vfQbG9GU3

@thehill Thank you 17.5 billion times!!!
Enough is enough.
This drawdown will bring the total U.S. military assistance for Ukraine to more than $17.5 billion since the beginning of this Administration.
